import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem } from 'reactstrap';


class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      rightIsExpanded: false,
      content: "This is the collapsed right panel",
    }
  }
  expandRight() {
      if (this.state.rightIsExpanded){
        RightPanel.content = "This is the expanded right panel"
      }
  }
  render() {
    return (
      <div>
        <NavBar />
        <LeftPanel className = "LeftPanel"/>
        <RightPanel className = "RightPanel" content = {this.state.content}/>
      </div>
    );
  }
}

class LeftPanel extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return(
      <div className = "LeftPanel">
          <p>This is the left panel</p>
      </div>
    )
  }
}


class RightPanel extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return(
      <div className = "RightPanel">
          <CollapseBtn  direction = "left" />
          <p>{this.props.content}</p>
      </div>
    )
  }
}

class CollapseBtn extends Component {

  render() {
    // console.log(this.props.direction);
    return(
      <div className={"triangle-" + this.props.direction}>
        {this.props.direction == "right" ? (<i className="right" />) : (<i className="left"/>)}
      </div>
    )
      }
}

class NavBar extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: false
    };
  }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }
  render() {
    return (
      <div>
        <Navbar color="light" light expand="md" className="topNav">
          <NavbarBrand href="/">Resuwee</NavbarBrand>
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto " navbar>
              <NavItem>
                <NavLink href="/components/">Edit Mode</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="">Resume Generator</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="">Donate</NavLink>
              </NavItem>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  Settings
                </DropdownToggle>
                <DropdownMenu right>
                  <DropdownItem>
                    Help
                  </DropdownItem>
                  <DropdownItem>
                    My Profile
                  </DropdownItem>
                  <DropdownItem>
                    Manage Resumes
                  </DropdownItem>
                  <DropdownItem divider />
                  <DropdownItem>
                    Logout
                  </DropdownItem>
                </DropdownMenu>
              </UncontrolledDropdown>
            </Nav>
          </Collapse>
        </Navbar>
      </div>
    );
  }
}


export default App;
